        function sendMessage() {
            var message = document.getElementById("messageInput").value.trim();
            if (message === "") return;
            db.ref("messages").push({ sender: username, text: message, isSticker: false, profile: profilePic });
            document.getElementById("messageInput").value = "";
            setTimeout(scrollToBottom, 100);
        }

        function sendSticker(stickerUrl) {
            db.ref("messages").push({ sender: username, text: stickerUrl, isSticker: true, profile: profilePic });
            toggleStickerMenu();
            setTimeout(scrollToBottom, 100);
        }

        db.ref("messages").on("child_added", function(snapshot) {
            var messageData = snapshot.val();
            var chatContainer = document.getElementById("chatContainer");
            var messageBubble = document.createElement("div");
            var userProfilePic = messageData.profile || "https://www.w3schools.com/howto/img_avatar.png";

            messageBubble.classList.add("chat-bubble");
            messageBubble.classList.add(messageData.sender === username ? "user" : "bot");

            var messageContent = document.createElement("div");
            messageContent.innerHTML = `<div class="username">${messageData.sender}</div>`;

            if (messageData.isSticker) {
                var img = document.createElement("img");
                img.src = messageData.text;
                img.style.width = "130px";
                img.style.height = "130px";
                messageContent.appendChild(img);
            } else {
                messageContent.innerHTML += `<div>${messageData.text}</div>`;
            }

            var profilePicElement = document.createElement("img");
            profilePicElement.src = userProfilePic;
            profilePicElement.classList.add("profile-pic");

            messageBubble.appendChild(profilePicElement);
            messageBubble.appendChild(messageContent);
            chatContainer.appendChild(messageBubble);

            scrollToBottom();
        });

            var chatContainer = document.getElementById("chatContainer");

document.addEventListener("DOMContentLoaded", function () {
    let tombol = document.getElementById("tombol-tiga-titik");
    let isDragging = false;

    tombol.addEventListener("mousedown", function (e) {
        isDragging = true;
        let offsetX = e.clientX - tombol.getBoundingClientRect().left;
        let offsetY = e.clientY - tombol.getBoundingClientRect().top;

        function onMouseMove(e) {
            if (!isDragging) return;
            let newX = e.clientX - offsetX;
            let newY = e.clientY - offsetY;

            // Biar nggak keluar layar
            newX = Math.max(0, Math.min(window.innerWidth - tombol.offsetWidth, newX));
            newY = Math.max(0, Math.min(window.innerHeight - tombol.offsetHeight, newY));

            tombol.style.left = newX + "px";
            tombol.style.top = newY + "px";
        }

        function onMouseUp() {
            isDragging = false;
            document.removeEventListener("mousemove", onMouseMove);
            document.removeEventListener("mouseup", onMouseUp);
        }

        document.addEventListener("mousemove", onMouseMove);
        document.addEventListener("mouseup", onMouseUp);
    });
});
